export default function reducer(state, action) {
  if (action.type === "TRUE") {
    return Object.assign({}, state, {
      isLoginPending: action.isLoginPending
    });
  }
  if (action.type === "FALSE") {
    return action.payload;
  }
  if (action.type === "LOGIN") {
    return action.payload;
  }
  return state;
}
